      alignSelf: 'center',
      marginTop: 50,
      alignContent: "center",
      //marginBottom: 50
      justifyContent: "center"
      },

    logo: {

      alignSelf: 'center',
      //marginRight: 225,
      height: 100,
      width: 190,
      resizeMode: "contain"
      //flexDirection: 'row'
    },

    signUpBtn:{
      alignSelf:'center',
      justifyContent: 'center',
      width: 300,
      height: 50,
      borderRadius: 30,
      marginTop: 25,
      //marginBottom: 75,     
      backgroundColor: "#0B0C10",
      borderColor: "#66FCF1",
      borderWidth: 1
      //borderWidth: 1,   
    },

    signIntext:{
      justifyContent: 'center',
      textAlign: 'center',
      fontFamily: "Verdana-Bold",
      fontSize: 20,
      color: '#fff5ee'
      //fontWeight: 'bold'
    },

    logInText:{

        fontFamily: "Verdana",
        fontSize: 15,
        color: 'gray',
      },

    logInView: {

      flexDirection: 'row', 
      marginTop: 50, 
      alignSelf :'center'
    },

    logIn: {

      fontFamily: "Verdana",
      fontSize: 15,
      color: '#66FCF1',
    },

    container: {
      flex: 1,
      alignContent: 'center',
      flexDirection: "column",
      backgroundColor: '#0B0C10',
    },

    head: {
        marginLeft: 0,
        flexDirection: "column",
        alignSelf: 'center',
        marginTop: 50
      },

    horizontal: {
      marginTop: 300,
      alignSelf: 'center',
      flexDirection: "row"
    },

    image: {
        flex: 1,
        resizeMode: "cover",
        justifyContent: "center"
    },

    text:{
        textAlign: 'left',
        fontFamily: "Verdana-Bold",
        fontSize: 40,
        color: "#66FCF1",
        alignSelf: 'flex-start'
    },

    signintext:{
      alignSelf: "center",
      fontFamily: "Verdana-Bold",
      fontSize: 20,
      color: '#000000'
    },


    inputContainer: {
      flex: 3,
      maxHeight: 45,
      width: 350,
      borderRadius: 10,
      flexDirection: 'row',
      backgroundColor: '#212121',
      alignItems: 'center',
      paddingHorizontal: 20,
      color: 'white',
      marginTop: 25,
      paddingTop: 15,
      paddingBottom: 10,
      marginBottom: 25,
      //marginLeft: 35,
      alignSelf: 'center',
      fontFamily: 'Verdana',
    },

    input: {
      flex: 3,
      maxHeight: 45,
      width: 350,
      borderRadius: 10,
      flexDirection: 'row',
      backgroundColor: '#212121',
      alignItems: 'center',
      paddingHorizontal: 20,
      color: 'white',
      marginBottom: 20,
      paddingTop: 15,
      paddingBottom: 10,
      //marginLeft: 35,
      alignSelf: 'center',
      fontFamily: 'Verdana',

    },

    username: {

      flex:1, 
      fontSize: 14, 
      borderColor: '#66FCF1',
      borderBottomWidth: 1, 
      color: 'white', 
      fontFamily: 'Verdana'

    },
    password: {

      flex:1, 
      fontSize: 14, 
      borderColor: '#66FCF1',
      borderBottomWidth: 1, 
      color: 'white',
      fontFamily: 'Verdana'

    },
  });

  export default Register;
